import React, { Component } from "react";

class BUBBLE extends Component {
  getN(n) {
    if (!n) {
      return "";
    }
    return n > 9 ? "9+" : n;
  }

  render() {
    const { value } = this.props;

    return <h6 className="bubble">{this.getN(value)}</h6>;
  }
}

export default BUBBLE;
